/// The SentenceBreak attribute for Unicode code-points.
#[derive(Debug,Clone,Copy,PartialEq)]
pub enum SentenceBreak {
    Other = 0,
    Sp = 1,
    Lf = 2,
    Cr = 3,
    STerm = 4,
    Close = 5,
    SContinue = 6,
    ATerm = 7,
    Numeric = 8,
    Upper = 9,
    Lower = 10,
    Sep = 11,
    Format = 12,
    OLetter = 13,
    Extend = 14,
}

/// Get the SentenceBreak attribute for a Unicode code-point.
///
/// # Arguments
///  - `code_point` A code-point in the form of a rust `char`.
///
/// # Returns
/// A SentenceBreak attribute of the Unicode code-point.
#[must_use] pub const fn get_sentence_break(code_point: char) -> SentenceBreak
{
    const INDEX_MASK : usize = (1 << SENTENCE_BREAK_INDEX_BITS) - 1;
    const COLUMN_MASK : usize = (1 << SENTENCE_BREAK_COLUMN_BITS) - 1;

    let code_point_value = code_point as usize;
    let code_point_lo = code_point_value % SENTENCE_BREAK_CHUNK_SIZE;
    let mut code_point_hi = code_point_value / SENTENCE_BREAK_CHUNK_SIZE;
    if code_point_hi > SENTENCE_BREAK_INDEX_LEN - 1 {
        code_point_hi = SENTENCE_BREAK_INDEX_LEN - 1;
    }

    let index_offset = code_point_hi * SENTENCE_BREAK_INDEX_BITS;
    let index_byte_offset = index_offset / 8;
    let index_bit_offset = index_offset % 8;
    let mut index: usize = 0;
    index |= (SENTENCE_BREAK_DATA[SENTENCE_BREAK_INDEX_BYTE_OFFSET + index_byte_offset + 1] as usize) << 8;
    index |= (SENTENCE_BREAK_DATA[SENTENCE_BREAK_INDEX_BYTE_OFFSET + index_byte_offset + 0] as usize) << 0;
    index >>= index_bit_offset;
    index &= INDEX_MASK;

    let column_offset = (index * SENTENCE_BREAK_CHUNK_SIZE + code_point_lo) * SENTENCE_BREAK_COLUMN_BITS;
    let column_byte_offset = column_offset / 8;
    let column_bit_offset = column_offset % 8;

    let mut value: usize = 0;
    value |= (SENTENCE_BREAK_DATA[column_byte_offset + 1] as usize) << 8;
    value |= (SENTENCE_BREAK_DATA[column_byte_offset + 0] as usize) << 0;
    value >>= column_bit_offset;
    value &= COLUMN_MASK;

    return match value {
        0 => SentenceBreak::Other,
        1 => SentenceBreak::Sp,
        2 => SentenceBreak::Lf,
        3 => SentenceBreak::Cr,
        4 => SentenceBreak::STerm,
        5 => SentenceBreak::Close,
        6 => SentenceBreak::SContinue,
        7 => SentenceBreak::ATerm,
        8 => SentenceBreak::Numeric,
        9 => SentenceBreak::Upper,
        10 => SentenceBreak::Lower,
        11 => SentenceBreak::Sep,
        12 => SentenceBreak::Format,
        13 => SentenceBreak::OLetter,
        14 => SentenceBreak::Extend,
        _ => SentenceBreak::Other,
    };
}

#[cfg(all(test, not(debug_assertions)))]
#[test]
fn sentence_break_full_coverage()
{
    for c in '\u{0000}'..='\u{d7ff}' {
        let _ = get_sentence_break(c);
    }
    for c in '\u{e000}'..='\u{10ffff}' {
        let _ = get_sentence_break(c);
    }
}

